        alert(Name)
        alert(Firstname)
        event.preventDefault();
    }

    return (
        <form>
            <h1>glhghjg</h1>
            <input value={Name} onChange={(e) => ChangeName(e.target.value)}>
            </input>
            <input value={Firstname} onChange={(e) => ChangeFirstname(e.target.value)}>
            </input>
            <button onClick={CheckButton}>
                Valider
            </button>
        </form>
    )
}

